import { Link } from 'react-router-dom';
import program from'./images/programe.jpg';

const Program = () => {
  return (
    <div>
        <div
        className="relative h-screen bg-fixed bg-cover bg-center"
        style={{ backgroundImage: `url(${program})` }}>
        <div className="absolute inset-0 bg-black opacity-50"></div>
        <div className="relative z-10 flex flex-col items-center justify-center h-full text-center text-white">
          <h1 className="text-6xl font-bold mb-4 text-left">CHALLENGE YOURSELF</h1>
          <p className="text-2xl font-bold mb-4 te">I'm a paragraph. Click here to add your own text and edit me. Let your users get to know you.</p>
        </div>
      </div>
    </div>
  );
}

export default Program;
